description:
Black Magic Woman is a sexually-tinged supernatural thriller involving the owner of an art gallery (Mark Hamill) who falls victim to the seductive and dangerous wiles of a coven of suburban witches -- the kind who brew their magic potions in the microwave -- when he enters a torrid affair with the smoldering Cassandra (Apollonia Kotero). When their relationship is threatened by a halfhearted devotion to his long-suffering girlfriend (Amanda Wyss), Hamill finds himself the tormented victim of a barrage of hexes, which run the gamut from horrific hallucinations to subversion of his will... and ultimately lead to madness and murder...

